rders have been relative stable for a long time but they are often worng with a lot of confusion. Lantmäteriet made official borders in 1995 that should be used. Norrbotten wasn\'t formally created until 1995 but have usually ben used for the part of Västerbotten that is in Norrbotten län that was created 1810. The borders of the "Landskap" is sometimes not following the borders and is crossing the borders of Socken/parish, kommun and Län.<p>\r\nFor district we use Socken/Parish. It\'s quite problematic with no consensus of names and borders. The parishes lost most of the administrive importance in 1863 du to to "kommunreform" when municipalities separated from the church where created. It created a split with "kyrksocknar" that the churched used and "jordregistersocknar" that was used for the real estate registry, it wasen\'t fully fased out until 1995. The modern church division is called "Församling" there is no clear difference between Församling and Socken.<p>\r\nThe modern administritive divisions Län and kommun/municipality is not used because we are dealing with historical data that rarely contain that information. Especially the kommun is also problematic because they are sometimes merged to bigger units because of political and practical reasons.<p>', 'Suecia, Sverige, Kingdom of Sweden, Konungariket Sverige, Schweden'),
